import React, { Component } from "react";
import "./NumberList";
import App from './../App'

class NumberList extends Component {
  render() {

    renderCalculations = ({ id, calc }) => {
      return <li key={id}>{calc}</li>;
    };

    let calcArray = this.props.calculationArray;

    const calcItems = calcArray.slice(0).reverse().map(this.renderCalculations);

    return <ul>{calcItems}</ul>;
  }
}

export default NumberList;
